import React from "react";
import "../Styles/main.css";
import "../Styles/Home.css";
import machine from "../Images/machine.jpg";
import gear from "../Images/gear.jpg";
import vending_machine from "../Images/vending_machine.jpg";

function Home() {
  return (
    <div>
      <div>
        <h2>Industries we serve</h2>
        <div className="flex-container">
          <div>
            <img src={machine}></img>
            <div>Add your text</div>
          </div>
          <div>
            <img src={gear}></img>
            <div>Add your text</div>
          </div>
          <div>
            <img src={vending_machine}></img>
            <div>Add your text</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
